#include<bits/stdc++.h>
using namespace std;
class Solution {
public:
    int numSubarrayProductLessThanK(vector<int>& nums, int k) {
        ios_base::sync_with_stdio(false);
        if(nums.size()==1) return (nums.at(0)<k) ? 1 : 0; 
        if(k==0) return 0;
        int i=0;
        int result = 0;
        while(i<nums.size()){
            if(nums.at(i)<k){
                result++;
                int j=i+1;
                long long prd=nums.at(i);
                while(j<nums.size()){
                    prd*=nums.at(j);
                    if(prd<k) {result++; }
                    else break;
                    j++;
                }
                if(j==nums.size()){
                    int n=j-i-1;
                    n=(n*(n+1)/2);
                    result+=n;
                    break;
                }
            }
            i++;
        }
        return result;
    }
};
